import React from "react";
import "./Menu.css";

function Menu(props) {
  let { isOpen } = props;

  return (
    <div className={isOpen ? "menu slideIn" : "menu slideOut"}>
      <ul>
        <li
          onClick={() => {
            isOpen = !isOpen;
          }}
        >
          Settings
        </li>
        <li
          onClick={() => {
            isOpen = !isOpen;
          }}
        >
          Account
        </li>
        <li
          onClick={() => {
            isOpen = !isOpen;
          }}
        >
          About
        </li>
        <li
          onClick={() => {
            isOpen = !isOpen;
          }}
        >
          Contacts
        </li>
      </ul>
    </div>
  );
}

export default Menu;
